            // placeholder:'',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输入用户名', trigger: 'blur' }\n          },\n          password: {\n            label: '密码',\n            // prop: 'pass',\n            // placeholder:'',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输入密码', trigger: 'blur' }\n          },\n          code: {\n            hide: true\n          }\n        }\n      },\n      option1: {\n        width: 400,\n        codeType: 'img',\n        column: {\n          username: {\n            label: '用户名',\n            placeholder: '手机号/邮箱/用户名',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输入用户名', trigger: 'blur' }\n          },\n          password: {\n            label: '密码',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输入密码', trigger: 'blur' }\n          },\n          code: {\n            label: '验证码',\n            tip: '点击图片可以刷新验证码',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输验证码', trigger: 'blur' }\n          }\n        }\n      },\n      option2: {\n        width: 400,\n        time: 60,\n        codeType: 'phone',\n        column: {\n          username: {\n            label: '手机号',\n            prefixIcon: 'el-icon-mobile-phone',\n            placeholder: '手机号/邮箱/用户名',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输入手机号', trigger: 'blur' }\n          },\n          password: {\n            hide: true,\n          },\n          code: {\n            label: '验证码',\n            autocomplete: 'off',\n            rules: { required: true, message: '请输验证码', trigger: 'blur' }\n          }\n        }\n      },\n      option3: {\n        width: 400,\n        time: 60,\n        labelWidth: 120,\n        codeType: 'phone',\n        column: {\n          username: {\n            label: '手机号',\n            prefixIcon: 'el-icon-mobile-phone',\